package leetcode.algorithms;

/**
 * Description: 3234. Count the Number of Substrings With Dominant Ones
 *
 * @author Baltan
 * @date 2024/7/28 19:20
 */
public class NumberOfSubstrings2 {
    public static void main(String[] args) {
        System.out.println(numberOfSubstrings("00011"));
        System.out.println(numberOfSubstrings("101101"));
        System.out.println(numberOfSubstrings(""));
    }

    public static int numberOfSubstrings(String s) {
        int result = 0;
        int length = s.length();
        /**
         * 枚举所有以字符s[i]开头的子串
         */
        for (int i = 0; i < length; i++) {
            /**
             * 子串中0的个数
             */
            int zeroCount = 0;
            /**
             * 子串中1的个数
             */
            int oneCount = 0;
            /**
             * 因为zeroCount^2<=oneCount<=length，所以zeroCount*zeroCount<length
             */
            for (int j = i; j < length && zeroCount * zeroCount < length; j++) {
                if (s.charAt(j) == '0') {
                    zeroCount++;
                } else {
                    oneCount++;
                }
                result += oneCount >= zeroCount * zeroCount ? 1 : 0;
            }
        }
        return result;
    }
}
